from dbbase import MusicDBRootDataIOfrom dbparse import MusicDBGroupDataIOfrom musicdb.albumoftheyear import MusicDBParamsfrom musicdb.albumoftheyear import MetaProducerIOdef test_metaprod():    params = MusicDBParams()    rdio = MusicDBRootDataIO(db=params.db, verbose=True)    gdio = MusicDBGroupDataIO(rdio, params, verbose=True)    gdio.addGroupData()        metaio = MetaProducerIO(rdio, verbose=True)    metaio.make(test=True)    if __name__ == "__main__":    test_metaprod()    